RT @berkhormah: الدكتور #نزار_باهبري في حديث من القلب إلى القلب 🤝
@DrNezarB 
فقط بـ 350 ريال نسد جوع اليتيم والفقير والأرملة والمحتاج طوال…

@Nabeelosis (المريض) السؤال: مين احسن دكتور في التخصص الفلاني؟ 
(الدكتور) الإجابة: مافي دكتور احسن من الثاني كلنا زي بعض. 
لا يوجد إنسان مثل الإنسان الاخر حتى التوأم مو مثل بعض. لهذا يجب الإجابة على سؤال المريض بصدق. فخلف الإجابة معايير وتجارب العديد من المرضى وقصص نجاح #أفضل_طبيب
